import React from 'react';
import AnimatedCursor from 'react-animated-cursor';
import '../styles/home.css'

const CustomCursor = () => { 
	return (
		<AnimatedCursor 
			innerSize={15}
			outerSize={10}
			color='150, 150, 150'
			innerScale={0.1}
			outerScale={5}
			showSystemCursor={false}
			outerStyle={{
				color: 'rgb(200, 0, 0)',
				zIndex: '1500'
			}}
			innerStyle={{
				zIndex: '1500'
			}}
		/>
	)
}

export default CustomCursor;
